import React from 'react';

const MovieList = ({movies}) => {
    return (
        <div className="row">
            {movies.map(movie => 
                <div key={movie.id} className="card">
                    <img src={`https://image.tmdb.org/t/p/w100${movie.poster_path}`} className="card-img-top card-img" alt={movie.title} />
                    <div className="card-body">
                        {/* <p class="card-text text-dark "></p> */}
                        <h4 className="text-primary">{movie.title}</h4>
                    </div>
                </div>
            )}
        </div>
    )
}

export default MovieList;
